$(function () {
    $.nette.init();
});
$("[modal]").unbind("click");

$("[modal]").click(function(e) {
    e.preventDefault();
    $.ajax({
        type: 'GET',
        url: $(this).attr("href"),
        data: {lte_no_layout: 1},
        success: function (r) {
            $("#modal .modal-content").html('<div class="mdl">'+r+'</div>');
            $("#modal").modal("show");
        }
    });
});
